import React, { useState } from 'react';
import { Layout, Menu } from 'antd';
import { MenuOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';

const { Header, Content } = Layout;

const MenuTest = ({ children }) => {
  const [collapsed, setCollapsed] = useState(false);

  const toggleCollapsed = () => {
    setCollapsed(!collapsed);
  };

  return (
    <Layout style={{ minHeight: '200vh' }}>
      <Header className="bg-gray-800 p-0">
        <div className="flex items-center justify-between h-full px-4">
          <div className="flex items-center">
            <div className="text-white mr-4">Logo</div>
            <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']} className="border-none">
              <Menu.Item key="1"><Link to="/">Home</Link></Menu.Item>
              <Menu.Item key="2"><Link to="/gameprediction">Game Prediction</Link></Menu.Item>
              <Menu.Item key="3"><Link to="/analysis">Analysis</Link></Menu.Item>
              <Menu.Item key="4"><Link to="/test">Test</Link></Menu.Item>
            </Menu>
          </div>
          <div className="text-white cursor-pointer" onClick={toggleCollapsed}>
            <MenuOutlined />
          </div>
        </div>
      </Header>
      <Content>
        <div className="p-4">{children}</div>
      </Content>
    </Layout>
  );
};

export default MenuTest;
